import numpy as np

#Task - 1 (Adjacency List)
class Node:

  def __init__(self, neighbour, next=None):
    self.neighbour = neighbour
    self.next = next

class AdjacencyList:

  def __init__(self, num):
    self.vertices = [None] * num

  def addEdge(self, fr, to):
    new1 = Node(to, self.vertices[fr])
    self.vertices[fr] = new1
    new2 = Node(fr, self.vertices[to])
    self.vertices[to] = new2

  def max_degree(self):
    max_d = 0
    vidx = -1
    for i in range(len(self.vertices)):
      c = 0
      tail = self.vertices[i]
      while tail != None:
        c += 1
        tail = tail.next
      if c > max_d:
        max_d = c
        vidx = i
    return max_d, vidx


graph = AdjacencyList(7)
edges = [
        (0, 1), (0, 2), (1, 2), (1, 3), (2, 3),
        (2, 4), (3, 4), (3, 5), (4, 5), (4, 6),
        (5, 6), (0, 3), (1, 4), (2, 5), (3, 6), (0, 6)
    ]
for i in edges:
  graph.addEdge(i[0], i[1])
max_degree, vertex_index = graph.max_degree()
print(f"Max Degree: {max_degree} at vertex {vertex_index}")

#Task - 1 (Adjacency Matrix)
class AdjacencyMatrix:

  def __init__(self, num):
    self.matrix = np.zeros((num, num), dtype = int)

  def addEdge(self, fr, to):
    self.matrix[fr][to] = 1
    self.matrix[to][fr] = 1

  def max_degree(self):
    max_d = 0
    vidx = -1
    for i in range(len(self.matrix)):
      c = 0
      for j in self.matrix[i]:
        if j > 0:
          c += 1
      if c > max_d:
        max_d = c
        vidx = i
    return max_d, vidx


