#Task - 4 (Adjacency List)
class Node:

  def __init__(self, neighbour, weight=1, next=None):
    self.neighbour = neighbour
    self.weight = weight
    self.next = next

class AdjacencyList:

  def __init__(self, num):
    self.vertices = [None] * num

  def addEdge(self, fr, to, w):
    new = Node(to, w, self.vertices[fr])
    self.vertices[fr] = new

  def display(self):
    for i in range(len(self.vertices)):
      print(f"Vertex {i}:", end=" ")
      tail = self.vertices[i]
      while tail != None:
        print(f"->{tail.neighbour} (weight {tail.weight})", end=" ")
        tail = tail.next
      print()


def convert_to_undirected(graph):
  new1 = AdjacencyList(len(graph.vertices))
  for fr in range(len(graph.vertices)):
    tail = graph.vertices[fr]
    while tail != None:
      new1.addEdge(fr, tail.neighbour, tail.weight)
      new1.addEdge(tail.neighbour, fr, tail.weight)
      tail = tail.next
  return new1


