class AdjacencyMatrix:

  def __init__(self, num):
    self.matrix = np.zeros((num, num), dtype = int)

  def addEdge(self, fr, to, w):
    self.matrix[fr][to] = w

  def display(self):
    for i in range(len(self.matrix)):
      p = ""
      for j in range(len(self.matrix[i])):
        p += str(self.matrix[i][j]) + " "
      print(p)


def convert_to_undirected(dg):
  n = len(dg.matrix)
  new1 = np.zeros((n, n), dtype=int)
  for i in range(n):
    for j in range(n):
      if dg.matrix[i][j] > dg.matrix[j][i]:
        w = dg.matrix[i][j]
      else:
        w = dg.matrix[j][i]
      new1[i][j] = w
      new1[j][i] = w
  udg = AdjacencyMatrix(n)
  udg.matrix = new1
  return udg


